import React from "react";

export default function Bill({info}) {
    return (
        <div>
          <h2>{info.date}</h2>
          <p>{info.hospital}</p>
          ,<p>{info.provider}</p>
          <p>{info.description}</p>
          <p>Amount: {info.amount}</p>
          {/* Render additional bill information here */}
        </div>
      );
}
